import { useState } from "react";
import { Box } from "@chakra-ui/core";
import { motion } from "framer-motion";
import { css } from "@emotion/core";

const Dials = props => {
  const [animate, setAnimate] = useState("visible");

  const icon = {
    hidden: {
      opacity: 0,
      pathLength: 0,
      fill: "rgba(255, 255, 255, 0)"
    },
    visible: {
      opacity: 1,
      pathLength: 1,
      fill: "rgba(255, 80, 70, 1)"
    },
    half: {
      opacity: 0.5,
      pathLength: 0.2,
      fill: "rgba(255, 80, 70, 0.7)"
    }
  };

  return (
    <Box w="400px" h="400px" bg="gray.500" p="4">
      <motion.svg
        xmlns="http://www.w3.org/2000/svg"
        viewBox="0 0 200 200"
        css={css`
          overflow: hidden;
          stroke: #fff;
          stroke-width: 5;
          stroke-linejoin: round;
          stroke-linecap: round;
        `}
      >
        <motion.path
          d="
            M 100, 100
            m -75, 0
            a 75,75 0 1,0 150,0
            a 75,75 0 1,0 -150,0
            "
          variants={icon}
          initial="hidden"
          animate={animate}
          transition={{
            fill: { delay: 1, duration: 0.9, ease: "easeInOut" },
            pathLength: { delay: 1, duration: 1 }
          }}
        />
      </motion.svg>
      <button onClick={() => setAnimate("half")}>test</button>
    </Box>
  );
};

export default Dials;
